import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./components/App";
import Project from "./components/Project";
import Poop from "./components/Poop";
import Footer from "./components/Footer";
import reportWebVitals from "./reportWebVitals";
import "bootstrap/dist/css/bootstrap.min.css";

ReactDOM.render(
  <React.StrictMode>
    <App />
    <div className="flex-container">
      <Project
        title="News Article Web Scraper"
        subtitle="Python, Flask, mySQL, Vue, Bootstrap, Axios"
        text="Collaborated with a team to develop a web scraper web app that scrapes news sites to algorithmically select positive articles. Script was written in python, and Flask backend made query calls to the mySQL database. The frontend was built using Vue and bootstrap, with axios handling HTTP requests.
        "
        sourceLink="https://github.com/lucmaxwell/McHacks-2021"
      />
      <Project
        title="ML Text Summarizer Web App"
        subtitle="Python, Flask, Bootstrap "
        text="Worked with a team to create a web app that uses an ML text summarizer and AI chatbot to make filling out insurance papers easier. Consisted of a Flask backend with frontend of HTML+CSS and Bootstrap."
        sourceLink="https://github.com/THe142857/shinz"
      />
    </div>

    <Poop />
    <Footer />
  </React.StrictMode>,
  document.getElementById("root")
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
